const OfertaBox = ({ isNew }) => {
    return (
        <div className="oferta-box">
            <h3>{isNew ? 'Nowość' : ''}</h3>
            <div className={`dot ${isNew ? 'red-dot' : ''}`}></div>
            {/* Dodatkowe treści boxu oferty */}
        </div>
    );
}

export default OfertaBox;
